import React from "react";

interface Props {
  uuid: string;
  title: string;
  body: string;
  votes: number;
  commentLength: number;
  username: string;
}

const CommunityPost: React.FC<Props> = ({
  uuid,
  title,
  body,
  username,
  votes,
  commentLength,
}) => {
  return (
    <React.Fragment>
      <div className="community-post-container">
        <p>Votes: {votes}</p>
        <p>{title}</p>
        <p>{body}</p>
        <p>{username}</p>
      </div>
    </React.Fragment>
  );
};

export default CommunityPost;
